script: |
  super -f text -I q9101.spq | sort > q9101.out

inputs:
  - name: q9101.spq
    data: |
      SELECT - ( - 51 ) AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 90 + - - col1 IN ( + 81, ( col2 ) + - + 54 );
  - name: tab1

outputs:
  - name: q9101.out
    data: |
      51
      51
      51
